import React from 'react';
import { TextField, Button, Snackbar, MenuItem, CircularProgress, Backdrop } from '@material-ui/core';
import MuiAlert from '@material-ui/lab/Alert';
import { makeStyles } from '@material-ui/core/styles';
import GridContainer from "../../components/Grid/GridContainer";
import GridItem from "../../components/Grid/GridItem";
import CardHeader from "../../components/Card/CardHeader";
import CardBody from "../../components/Card/CardBody";
import Card from "../../components/Card/Card";

export default function AddUsers(){
    const useStyles = makeStyles((theme) => ({
        backdrop: {
            zIndex: theme.zIndex.drawer + 1,
            color: '#fff',
        },
        paper: {
            marginTop: theme.spacing(8),
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
        },
        avatar: {
            margin: theme.spacing(1),
            backgroundColor: theme.palette.secondary.main,
        },
        form: {
            width: '100%', // Fix IE 11 issue.
            marginTop: theme.spacing(1),
        },
        submit: {
            margin: theme.spacing(3, 0, 2),
        },
        button: {
            margin: theme.spacing(1),
            backgroundColor: '#00acc1',
            color: '#fff'
        },
    }));

    const classes = useStyles();
    return(
        <GridContainer>
        <GridItem xs={12} sm={12} md={2}></GridItem>
        <GridItem xs={12} sm={12} md={8}>
            <form className={classes.root} noValidate autoComplete="on">
                <Card>
                    <CardHeader color="warning">
                        <h4 className={classes.cardTitleWhite}>Add User</h4>
                        <p className={classes.cardCategoryWhite}>All fields are mandatory</p>
                    </CardHeader>
                    <CardBody>
                        <GridContainer>
                            <GridItem xs={12} sm={12} md={12}>
                            <TextField
                                    margin="normal"
                                    fullWidth
                                    id="client"
                                    label="Client"
                                />
                        </GridItem>
                        </GridContainer>
                        </CardBody>
                        </Card>
                        </form>
        </GridItem>
        </GridContainer>                            
)}
